'Neurocomics'

Last Gasp Eco Funnies, Mar 1979, 36 pages

Timothy Leary on space migration, increasing intelligence, and life extension.

Contributions from Pete Von Sholly, Tim Kummero, Timothy Leary, George DiCaprio

